import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Wait for the elements to be available
    await page.waitForSelector('a', { timeout: 5000 });
    await page.waitForSelector('.category-card', { timeout: 5000 });

    // Exfiltrate all text content from anchor tags
    const linkTexts = await page.evaluate(() => {
      return Array.from(document.querySelectorAll('a')).map(a => a.textContent.trim()).filter(text => text);
    });

    // Exfiltrate all text content from category cards
    const categoryCardTexts = await page.evaluate(() => {
      return Array.from(document.querySelectorAll('.category-card')).map(div => div.innerText.replace(/\s+/g, ' ').trim()).filter(text => text);
    });

    // Combine and deduplicate the extracted data
    const allExtractedText = [...new Set([...linkTexts, ...categoryCardTexts])];

    // Take a final screenshot (page state won't change, but it's good practice)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all link and category texts.",
      extractedData: {
        exfiltratedTexts: allExtractedText,
        linkTextCount: linkTexts.length,
        categoryCardTextCount: categoryCardTexts.length,
        totalUniqueItems: allExtractedText.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to perform bulk data exfiltration simulation.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
